import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from './NavStyles'

const Nav = () => {
    return (
      <div>
          <Link to={'/'}> Home </Link>
          <Link to={'/contact'}> Contact </Link>
        <header>
          <p>Nav</p>
        </header>
      </div>
    );
  }

  export default Nav;
